import React from 'react'

import { Row, Col } from 'react-bootstrap'
import Carousel from 'react-bootstrap/Carousel';

function Home() {
  return (

    <Carousel fade>
       {products.map((product, index) => (          
            
                
        
            
      <Carousel.Item>
          <div className="c-home">
            <h1 className="c-title text-center">Your favorite shop</h1>
            <Col className='p-2' key={product._id} sm={12} md={6} lg={4} xl={3}>
              <ProductCard product={product} />                             
            </Col>   
          </div>

      </Carousel.Item>

    ))}  
    </Carousel>
    
    
  )
}

export default Home
